import React from 'react';

import logoImg from "./images/bg.svg"

function App() {
  return (
    <div id="page-landing">
      <div className="content-wrapper">
        <img src={logoImg} alt="Logo" />
      </div>
      <h1>Hello World!! </h1>
    </div>
  );
}

export default App;
